import Rebase from 're-base';
import firebase from 'firebase';

const firebaseApp = firebase.initializeApp({
  apiKey: 'AIzaSyChxIiVTCIsmy6uirqZM4a7LyqYI0SiCsA',
  authDomain: 'catch-of-the-day-dan-mennella.firebaseapp.com',
  databaseURL: 'https://catch-of-the-day-dan-mennella.firebaseio.com'
});

const base = Rebase.createClass(firebaseApp.database());

// named export
export { firebaseApp };
//this is a deafualt export
export default base;
